let map, infoWindow;

//         SELECT room_id, ( 6371 * acos( cos( radians(24.19015959) ) * cos( radians( lat ) ) * cos( radians( lon ) - radians(120.5754135) ) + sin( radians(24.19015959) ) * sin( radians( lat ) ) ) ) AS distance FROM room_table HAVING distance < 25 ORDER BY distance LIMIT 0 , 20;

async function initMap() {
	const { Map } = await google.maps.importLibrary("maps");

	map = new Map(document.getElementById("map"), {
		center: {
			lat: 24.190159592769863,
			lng: 120.57541359786987,
		},
		zoom: 14,
		mapTypeControl: false,
		styles: [
			{
				"featureType": "road.arterial",
				"elementType": "labels",
				"stylers": [
					{
						"visibility": "off"
					}
				]
			},
		]

	});


	infoWindow = new google.maps.InfoWindow();

	const locationButton = document.createElement("button");
	locationButton.id = 'locationButton';
	locationButton.textContent = "點擊取得現在位置";
	locationButton.classList.add("custom-map-control-button");
	map.controls[google.maps.ControlPosition.TOP_CENTER].push(locationButton);
	locationButton.addEventListener("click", () => {
		getLocation()
	});

	function getLocation() {
		if (navigator.geolocation) {
			navigator.geolocation.getCurrentPosition(
				(position) => {
					const userPosition = {
						lat: position.coords.latitude,
						lng: position.coords.longitude,
					};

					infoWindow.setPosition(userPosition);
					infoWindow.setContent("所在地位置");
					infoWindow.open(map);
					map.setCenter(userPosition);
				},
				() => {
					handleLocationError(true, infoWindow, map.getCenter());
				}
			);
		} else {
			// Browser doesn't support Geolocation
			handleLocationError(false, infoWindow, map.getCenter());
		}
	}
	$.ajax({
		url: '/pillowSurfing/map',  // 後端 API 地址
		method: 'GET',
		dataType: 'json',
		success: function(data) {
			// 將 JSON 數據顯示在 div 中
			//$('#jsonData').text(JSON.stringify(data));
			displayMarkers(data);
		}, error: function() {
			console.error('Failed to fetch JSON data.');
		}
	});

	function displayMarkers(data) {
		var markers = [];

		for (let i = 0; i < data.length; i++) {
			let marker = new google.maps.Marker({
				position: { lat: data[i].lat, lng: data[i].lon },
				map: map,
				title: data[i].title
			});
			var result = data[i].file_path.split("/").slice(1).join("/")
			let infowindow = new google.maps.InfoWindow({
				content: `<img src='${result}' alt="檔案圖片" style="width:150px">`+
				          `<p>${data[i].title}</p>`,
				maxWidth: 200
			});
				console.log(infowindow)

			marker.addListener("click", () => {
				infowindow.open(map, marker);
			});

			markers.push({ marker, infowindow });
		}

		// 在地圖初始化完成後打開所有資訊窗口
		google.maps.event.addListenerOnce(map, "idle", function() {
			for (let i = 0; i < markers.length; i++) {
				markers[i].infowindow.open(map, markers[i].marker);
			}
		});
	}

	function handleLocationError(browserHasGeolocation, infoWindow, pos) {
		infoWindow.setPosition(pos);
		infoWindow.setContent(
			browserHasGeolocation
				? "Error: The Geolocation service failed."
				: "Error: Your browser doesn't support geolocation."
		);
		infoWindow.open(map);
	}
}
initMap();

